import React, { PureComponent } from 'react'
import './HobbiesInterest.css'

class HobbiesInterest extends PureComponent {
    constructor(props) {
        super(props)

        this.state = {
            
        }
    }

    render() {
        return (
            <div>
                <h1>Hobbies and Interests</h1>
                <div className="hobbies-interests">
                    <div>
                        <h2>Travel</h2>
                        <p>Traveling is a passion of mine. I love to explore new places, meet new people, and try new foods. I have been to several countries in Europe, Asia, and North America. I hope to visit South America and Africa in the near future.</p>
                    </div>
                    <div>
                        <h2>Reading</h2>
                        <p>I enjoy reading books on a wide range of topics, including history, science fiction, and self-help. Some of my favorite authors are Haruki Murakami, Yuval Noah Harari, and Malcolm Gladwell.</p>
                    </div>
                    <div>
                        <h2>Photography</h2>
                        <p>Photography is a hobby of mine. I love capturing moments and telling stories through pictures. I have a Nikon D750 camera and enjoy taking photos of landscapes, people, and events.</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default HobbiesInterest
